import "./App.css";
import "./Home.css";

function Home() {
  return (
    <div className="home">
      <div className="container">
        <div className="recommend">
          <div className="a"></div>
        </div>
        <div className="contents">
          <div className="dogsearch">
            <div className="b"></div>
          </div>
          <div className="hospital">
            <div className="c"></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
